description:
Burma Bridge Busters

War Documentary hosted by George Herbert Bush, published by History Channel in 2003 - English narration


Information
------------------------------

This compelling documentary takes an in-depth look at the 490th US Army Air Corps Bomb Squadron, who flew numerous bombing missions in China-Burma-India -- the so-called &quot;forgotten theater&quot; of WWII.
Between February 1943 and August 1945, the squadron flew 615 missions, dropped 8,257,000 pounds of bombs and destroyed 192 bridges, earning them the nickname &quot;Burma Bridge Busters.&quot;
With an original score by Emmy nominated composer Nathan Wang, and vintage recordings of performances by Glenn Miller and His Army Air Force Band, &quot;Burma Bridge Busters&quot; is a heartfelt tribute to the brave men of the 490th Squadron, and all who served in the China-Burma-India theater of WWII.
BURMA BRIDGE BUSTERS is hosted by President George Herbert Walker Bush, himself a former WWII flyer. Produced and directed by Emmy and Oscar winning filmmaker James Moll (The Last Days), the film is a presentation of the National D-Day Museum and The History Channel.

